package outCa.model.vo;

public class OutCa {
	private int outCaNo;
	private int outCaAn;
	private String outCaMi;
	private int outCaPrice;
	private int outCaStore;
	private String outCaDate;
	private String outCaEmp;
	private String outCaCon;
	private String outCaPath;
	private int sort;
	public OutCa() {
		super();
		// TODO Auto-generated constructor stub
	}
	public OutCa(int outCaNo, int outCaAn, String outCaMi, int outCaPrice, int outCaStore,
			String outCaDate, String outCaEmp, String outCaCon, String outCaPath, int sort) {
		super();
		this.outCaNo = outCaNo;
		this.outCaAn = outCaAn;
		this.outCaMi = outCaMi;
		this.outCaPrice = outCaPrice;
		this.outCaStore = outCaStore;
		this.outCaDate = outCaDate;
		this.outCaEmp = outCaEmp;
		this.outCaCon = outCaCon;
		this.outCaPath = outCaPath;
		this.sort = sort;
	}
	public int getOutCaNo() {
		return outCaNo;
	}
	public void setOutCaNo(int outCaNo) {
		this.outCaNo = outCaNo;
	}
	public int getOutCaAn() {
		return outCaAn;
	}
	public void setOutCaAn(int outCaAn) {
		this.outCaAn = outCaAn;
	}
	public String getOutCaMi() {
		return outCaMi;
	}
	public void setOutCaMi(String outCaMi) {
		this.outCaMi = outCaMi;
	}
	public int getOutCaPrice() {
		return outCaPrice;
	}
	public void setOutCaPrice(int outCaPrice) {
		this.outCaPrice = outCaPrice;
	}
	public int getOutCaStore() {
		return outCaStore;
	}
	public void setOutCaStore(int outCaStore) {
		this.outCaStore = outCaStore;
	}
	public String getOutCaDate() {
		return outCaDate;
	}
	public void setOutCaDate(String outCaDate) {
		this.outCaDate = outCaDate;
	}
	public String getOutCaEmp() {
		return outCaEmp;
	}
	public void setOutCaEmp(String outCaEmp) {
		this.outCaEmp = outCaEmp;
	}
	public String getOutCaCon() {
		return outCaCon;
	}
	public void setOutCaCon(String outCaCon) {
		this.outCaCon = outCaCon;
	}
	public String getOutCaPath() {
		return outCaPath;
	}
	public void setOutCaPath(String outCaPath) {
		this.outCaPath = outCaPath;
	}
	public int getSort() {
		return sort;
	}
	public void setSort(int sort) {
		this.sort = sort;
	}
	
}
